This sample shows how to call GetPrivateAccessAsync and parse the result.

TokenCredential credential = new DefaultAzureCredential();
PrivateAccessesClient client = new PrivateAccessesClient(Guid.Parse("73f411fe-4f43-4b4b-9cbd-6828d8f4cf9a"), credential);

Response response = await client.GetPrivateAccessAsync("<resourceGroupName>", "<privateAccessName>", null);

JsonElement result = JsonDocument.Parse(response.ContentStream).RootElement;
Console.WriteLine(result.GetProperty("properties").ToString());
Console.WriteLine(result.GetProperty("location").ToString());

